import React, { useState, useEffect } from "react";
import { Container, Row, Col, Image, Button, Dropdown } from "react-bootstrap";
import { useHistory } from "react-router-dom";
import Header from "../component/header";
import "./Category.scss";
import CardCategory from "../component/CardCategory";
const Category = () => {
  return (
    <div className="container">
      <Container fluid>
        <Row>
          <Header />
        </Row>
        <Row>
        <Row>
          <Col xs={4}> <CardCategory category = "Cars" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col  xs={4}> <CardCategory category = "Bikes" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col  xs={4}> <CardCategory category = "Furniture" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
        </Row>
        <Row>
          <Col> <CardCategory category = "Jobs" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Electronics&Appliances" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Fashion" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
        </Row>
        <Row>
          <Col> <CardCategory category = "Mobiles" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Services" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Properties" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
        </Row>
        <Row>
          <Col> <CardCategory category = "Pets" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Books,Sports&Hobbies" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
          <Col> <CardCategory category = "Others" categoryUrl = "bmw-57e3d44049_1280.jpg"/></Col>
        </Row>
        </Row>

      </Container>
    </div>
  );
};

export default Category;
